[{"location":"#AstrodynamicsUtilities","page":"Home","title":"AstrodynamicsUtilities","text":"Documentation for AstrodynamicsUtilities.","category":"section"},{"location":"#API","page":"Home","title":"API","text":"","category":"section"},{"location":"#AstrodynamicsUtilities.coe2rv-Tuple{Any, Any}","page":"Home","title":"AstrodynamicsUtilities.coe2rv","text":"coe2rv: Calculate the inertial position and velocity vectors from Keplerian classical orbital elements.\n\nInputs:\n\n`vec`: 6-element vector containing:\n    a: semi major axis (km)\n    e: eccentricity\n    inc: inclination (radians)\n    RAAN: right-ascension (radians)\n    w: argument of perigee (radians)\n    trueAnom: true anomaly (radians)\n`mu`: gravitational parameter of central body (km^3/s^2)\n\nReturns:\n\n`rv`: 6-element vector of position and velocity\n\n\n\n\n\n","category":"method"},{"location":"#AstrodynamicsUtilities.rv2coe-Tuple{Any, Any}","page":"Home","title":"AstrodynamicsUtilities.rv2coe","text":"rv2coe(r, v, mu)\n\nCalculate the 6 classical keplerian orbital elements from r, v, mu (under the two body problem)\n\nInputs:\n\nr: inertial position vector (km)\nv: inertial velocity vector (km/s)\nmu: gravitational parameter of central body (km^3/s^2)\n\nreturns:\n\ncoe: vector of 6 Keplerian elements, which are:\n\n    a: semi major axis (km)\n    e: eccentricity\n    inc: inclination (radians)\n    RAAN: right-ascension (radians)\n    argPer: argument of perigee (radians)\n    trueAnom: true anomaly (radians)\n\n\n\n\n\n","category":"method"},{"location":"#AstrodynamicsUtilities.transform-Union{Tuple{TP}, Tuple{CartesianState{TP}, KeplerianState{Nothing}, Any}} where TP<:(AbstractVector)","page":"Home","title":"AstrodynamicsUtilities.transform","text":"function transform(old::CartesianState{TP}, new::KeplerianState{Nothing}) where TP<:AbstractVector\n\nTransforms an inertial Cartesian state to an inertial Keplerian state. Uses the 'rv2coe' algorithm from Fundamentals of Astro. Vallado (2001).\n\nInputs:\n\nold: Cartesian state vector container\nnew_type: Flag to define what type to transform to. This method is to transform to KeplerianState().\nmu: gravitational parameter of central body (e.g., 398600.4418) for Earth in km^3/s^2\n\nReturns:\n\nKeplerianState(vec): Keplerian container with transformed vec\n\n\n\n\n\n","category":"method"},{"location":"#AstrodynamicsUtilities.transform-Union{Tuple{TP}, Tuple{KeplerianState{TP}, CartesianState{Nothing}, Any}} where TP<:(AbstractVector)","page":"Home","title":"AstrodynamicsUtilities.transform","text":"function transform(old::KeplerianState{TP}, new_type::CartesianState{Nothing}, mu) where TP<:AbstractVector\n\nTransforms an inertial keplerian state to an inertial ceplerian state. Uses the 'coe2rv' algorithm from Fundamentals of Astro. Vallado (2001).\n\nInputs:\n\nold: keplerian state vector container\nnew_type: Flag to define what type to transform to. This method is to transform to CartesianState().\nmu: gravitational parameter of central body (e.g., 398600.4418) for Earth in km^3/s^2\n\nReturns:\n\nKeplerianState(vec): Keplerian container with transformed vec\n\n\n\n\n\n","category":"method"}]
